import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import styled from 'styled-components/native';

const Container = styled.View`
    flex: 1;
    background-Color: '#FFFFFF';
    padding: 25px;
`;

const storeName = styled.Text`
    font-Family: 'Bold';
    font-Size: 20;
    margin-Bottom: 15;
`;

const storeInfoWrap = styled.View`
    flex-Direction: 'row';
    justify-Content: 'space-between';
    margin-Bottom: 10;
`;

const StoreInfoTap = () => {
    const storeInfo =
    {
        storeName: "맛사랑",
        storeTel: "032-860-1234",
        storeDayOff: '매일',
        storeOpenTime: '09:00',
        storeCloseTime: '20:00',
        storePriceRange: '1만원 이하',
        storeLoaction: '인천광역시 미추홀구 인주대로 123번길 20'
    }

    return (
        <Container>
            <storeName>{storeInfo.storeName}</storeName>
            <storeInfoWrap>
                <Text style={styles.storeInfoTitle}>전화번호</Text>
                <Text style={styles.storeInfoText}>{storeInfo.storeTel}</Text>
            </storeInfoWrap>
            <View style={styles.storeInfoWrap}>
                <Text style={styles.storeInfoTitle}>휴무일/영업시간</Text>
                <Text style={styles.storeInfoText}>{storeInfo.storeDayOff} / {storeInfo.storeOpenTime} ~ {storeInfo.storeCloseTime}</Text>
            </View>
            <View style={styles.storeInfoWrap}>
                <Text style={styles.storeInfoTitle}>가격대</Text>
                <Text style={styles.storeInfoText}>{storeInfo.storePriceRange}</Text>
            </View>
            <View style={styles.storeInfoWrap}>
                <Text style={styles.storeInfoTitle}>주소</Text>
                <Text style={styles.storeInfoText}>{storeInfo.storeLoaction}</Text>
            </View>
            <View style={styles.storeMapWrap}>
                <Text style={styles.storeInfoTitle}>지도</Text>
            </View>
        </Container>
    );
}


const styles = StyleSheet.create({

    storeInfoTitle: {
        fontFamily: 'Regular',
        fontSize: 12,
        color: 'gray'
    },
    storeInfoText: {
        fontFamily: 'Meduim',
        fontSize: 12,
        color: 'gray'
    }
});

export default StoreInfoTap;
